package com.sweet.core.model;import com.sweet.core.exception.enums.BizExceptionEnum;public class ResultError extends ResultBean {    public ResultError(String message){        super(ResultBean.DEFAULT_ERROR_CODE,message, null);    }    public ResultError(Integer code, String message) {        super( code, message, null);    }    public ResultError(Integer code, String message, Object object) {        super( code, message, object);    }    public ResultError(BizExceptionEnum exceptionEnum) {        super( exceptionEnum.getCode(), exceptionEnum.getMessage(), null);    }}